/* global groundhogg_gutenberg_form_selector, wp */
'use strict';

const { __ } = wp.i18n;
const { createElement } = wp.element;
const { registerBlockType } = wp.blocks;
const { InspectorControls } = wp.editor;
const { SelectControl, ToggleControl, PanelBody, ServerSideRender, Placeholder } = wp.components;

const gh_icon = <svg xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" width="889" height="992" viewBox="0 0 889 992"><image width="885" height="992" xlinkHref="data:img/png;base64,"/></svg>;

registerBlockType( 'groundhogg/forms', {
    title: groundhogg_gutenberg_form_selector.i18n.title,
    description: groundhogg_gutenberg_form_selector.i18n.description,
    icon: gh_icon,
    keywords: [ __( 'form' ), 'groundhogg', __( 'optin' ) ],
    category: 'widgets',
    attributes: {
        formId: {
            type: 'string',
        },
        displayTitle: {
            type: 'boolean',
        },
        displayDesc: {
            type: 'boolean',
        },
    },
    edit( props ) {
        const { attributes: { formId = '', displayTitle = false, displayDesc = false }, setAttributes } = props;
        const formOptions = groundhogg_gutenberg_form_selector.forms.map( value => (
            { value: value.ID, label: value.step_title }
        ) );

        let jsx;

        formOptions.unshift( { value: '', label: groundhogg_gutenberg_form_selector.i18n.form_select } );

        function selectForm( value ) {
            setAttributes( { formId: value } );
        }

        function toggleDisplayTitle( value ) {
            setAttributes( { displayTitle: value } );
        }

        function toggleDisplayDesc( value ) {
            setAttributes( { displayDesc: value } );
        }

        jsx = [
            <InspectorControls key="groundhogg-gutenberg-form-selector-inspector-controls">
                <PanelBody title={ groundhogg_gutenberg_form_selector.i18n.form_settings }>
                    <SelectControl
                        label={ groundhogg_gutenberg_form_selector.i18n.form_selected }
                        value={ formId }
                        options={ formOptions }
                        onChange={ selectForm }
                    />
                </PanelBody>
            </InspectorControls>
        ];

        if ( formId ) {
            jsx.push(
                <fieldset disabled>
                <ServerSideRender
                    key="groundhogg-gutenberg-form-selector-server-side-renderer"
                    block="groundhogg/forms"
                    attributes={ props.attributes }
                />
                </fieldset>
            );
        } else {
            jsx.push(
                <Placeholder
                    key="groundhogg-gutenberg-form-selector-wrap"
                    className="groundhogg-gutenberg-form-selector-wrap">
                    <div style={ { display: 'block', width: '100%' } }>
                        <img src={ groundhogg_gutenberg_form_selector.logo_url } className="gh-img-phil" width={100} height={100} />
                    </div>

                    <SelectControl
                        key="groundhogg-gutenberg-form-selector-select-control"
                        value={ formId }
                        options={ formOptions }
                        onChange={ selectForm }
                    />
                </Placeholder>
            );
        }

        return jsx;
    },

    save() {
        return null;
    },

} );


